        public static List<ListItem> ObterCategorias()
        {
            List<ListItem> lista = new List<ListItem>();
            
            //String arquivo = ConfigurationManager.AppSettings["PathLista"] + "Categorias.xml";
            XmlDocument xmlDoc = new XmlDocument();
            String xmlData = "<?xml version=\"1.0\" encoding=\"utf-8\" ?><categorias>  <categoria value='Alimentos e Bebidas' text='Alimentos e Bebidas'/>  <categoria value='Áudio' text='Áudio'/>  <categoria value='Automotivo' text='Automotivo'/>  <categoria value='Ar-condicionado e Aquecedores' text='Ar-condicionado e Aquecedores'/>  <categoria value='Bebês' text='Bebês'/>  <categoria value='Beleza e Saúde' text='Beleza e Saúde'/>  <categoria value='Brinquedos' text='Brinquedos'/>  <categoria value='Blu-ray e Blu-ray 3D' text='Blu-ray e Blu-ray 3D'/>  <categoria value='Cama, Mesa e Banho' text='Cama, Mesa e Banho'/>  <categoria value='Câmeras e Filmadoras' text='Câmeras e Filmadoras'/>  <categoria value='Celulares e Telefones' text='Celulares e Telefones'/>  <categoria value='Decoração de Natal' text='Decoração de Natal'/>  <categoria value='Eletrodomésticos' text='Eletrodomésticos'/>  <categoria value='Eletrônicos' text='Eletrônicos'/>  <categoria value='Eletroportáteis' text='Eletroportáteis'/>  <categoria value='Esporte e Lazer' text='Esporte e Lazer'/>  <categoria value='Ferramentas e Jardim' text='Ferramentas e Jardim'/>  <categoria value='Filmes e Séries' text='Filmes e Séries'/>  <categoria value='Games' text='Games'/>  <categoria value='Informática' text='Informática'/>  <categoria value='Informática e Acessórios' text='Informática e Acessórios'/>  <categoria value='Instrumentos Musicais' text='Instrumentos Musicais'/>  <categoria value='Livros' text='Livros'/>  <categoria value='Malas de Viagem' text='Malas de Viagem'/>  <categoria value='Moda e Acessórios' text='Moda e Acessórios'/>  <categoria value='Móveis e Decoração' text='Móveis e Decoração'/>  <categoria value='Música' text='Música'/>  <categoria value='Papelaria' text='Papelaria'/>  <categoria value='Perfumaria e Cosméticos' text='Perfumaria e Cosméticos'/>  <categoria value='Pet Shop' text='Pet Shop'/>  <categoria value='Relógios e Presentes' text='Relógios e Presentes'/>  <categoria value='Utilidades Domésticas' text='Utilidades Domésticas'/>  <categoria value='Outros' text='Outros'/></categorias>";

            xmlDoc.LoadXml(xmlData);

            XmlNodeList xnList = xmlDoc.GetElementsByTagName("categoria");
            for (int i = 0; i < xnList.Count; i++)
            {
                lista.Add(new ListItem() { Text = xnList[i].Attributes[0].Value, Value = xnList[i].Attributes[1].Value });
            }
            lista.Insert(0, new ListItem() { Text = "-- Selecione --", Value = "0" });
            return lista;

        }
        /// <summary>
        /// Retorno Lista de estados Brasileiros
