            //String arquivo = ConfigurationManager.AppSettings["PathLista"] + "Estados.xml";
            XmlDocument xmlDoc = new XmlDocument();
            String xmlData = "<?xml version=\"1.0\" encoding=\"utf-8\" ?><Estados>  <Estado value='AC' text='AC'/>  <Estado value='AL' text='AL'/>  <Estado value='AM' text='AM'/>  <Estado value='AP' text='AP'/>  <Estado value='BA' text='BA'/>  <Estado value='CE' text='CE'/>  <Estado value='DF' text='DF'/>  <Estado value='ES' text='ES'/>  <Estado value='GO' text='GO'/>  <Estado value='MA' text='MA'/>  <Estado value='MG' text='MG'/>  <Estado value='MS' text='MS'/>  <Estado value='MT' text='MT'/>  <Estado value='PA' text='PA'/>  <Estado value='PB' text='PB'/>  <Estado value='PE' text='PE'/>  <Estado value='PI' text='PI'/>  <Estado value='PR' text='PR'/>  <Estado value='RJ' text='RJ'/>  <Estado value='RN' text='RN'/>  <Estado value='RO' text='RO'/>  <Estado value='RR' text='RR'/>  <Estado value='RS' text='RS'/>  <Estado value='SC' text='SC'/>  <Estado value='SE' text='SE'/>  <Estado value='SP' text='SP'/>  <Estado value='TO' text='TO'/></Estados>";

