            StreamWriter writer = new StreamWriter(stream);
            writer.Write(xmlData);
            writer.Flush();
            stream.Position = 0;

            XElement cont = XElement.Load(stream);

            var query = from c in cont.Elements()
                        select c;

            List<ListItem> lista = new List<ListItem>();
            foreach (XElement cidade in query)
            {
                lista.Add(new ListItem() { Text = cidade.FirstAttribute.Value, Value = cidade.FirstAttribute.Value });
            }
            lista.Insert(0, new ListItem() { Text = "-- Selecione --", Value = "0" });

            return lista;

